import { Component } from '@angular/core';

@Component({
  selector: 'app-start-game',
  templateUrl: './start-game.component.html',
  styleUrls: ['./start-game.component.css']
})
export class StartGameComponent {

  startGame(){
    this.router.navigate(["/level1"])
  }
}
<div class="container">
    <img src="../../assets/images/bg.jpeg" alt="background image" style="width:100%;">
<div class="centered">
    <h1 class = "begin">Let's Begin</h1>
    <button (click)="startGame()" class = "startBtn">Start</button>
</div>
</div>
